import React, { useEffect } from 'react'
import TopMenu from '../components/TopMenu'
import { connect } from 'react-redux'
import { getAllConnectedPages } from '../actions'
import PageCart from '../components/PageCart'

function Agent(props) {
    useEffect(() => {
        props.getallConnectedPages()
    }, [])
    return (
        <div>
            <TopMenu />
            <div style={{ paddingLeft: 30, paddingRight: 30, paddingTop: 30 }}>
                <h2 style={{ fontSize: 30, color: "rgba(45, 47, 57, 1)" }}>Pages connected</h2>
                {props.allConnectedPages ?
                    Object.keys(props.allConnectedPages).map(el => <PageCart key={props.allpages[el]._id} name={props.allpages[el].name} connected={props.allpages[el].isConnected} page={props.allpages[el]} />) :
                    <h2>Loading</h2>
                }
            </div>
        </div>
    )
}

const mapStateToProps = (state) => {
    return {
        allConnectedPages: state.allConnectedPages
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        getallConnectedPages: () => dispatch(getAllConnectedPages())
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Agent)
